import React, { Component } from 'react';
import Tile from './Tile.js'

function TileGrid(props) {
    return(
        <>
        <Tile name='cat folder' image='dog' isFolder={true} ></Tile>
        <Tile name='School' image='school' ></Tile>
        </>
    );
}

export default TileGrid;
